import React, { Component } from 'react'
import { Line } from 'react-chartjs-2'

export default class OverTime extends Component {

  render() {

    let last30Days = {
      data: {
          labels: this.props.labels,
          datasets: [{
              label: 'Money Spent',
              // CHANGE THIS KEY/VALUE TO DISPLAY DATA POINTS
              data: (1, 30),
              backgroundColor: [
                  'rgba(0, 255, 0, .4)',
              ],
              borderColor: [
                  'green',
              ],
              borderWidth: 1
          }]
      }
    }

    return (
      <div>
        <Line
          data={last30Days.data}
          width={750}
          height={500}
          options={{
            title: {
              text: 'Session Winning Percentage',
              display: true,
              fontsize: 200
            },
            legend: {
              display: true,
              position: "bottom"
            }
          }}
        />
      </div>
    )
  }
}
